pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";
import "@openzeppelin/contracts/utils/Counters.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

import "./common/meta-transactions/ContentMixin.sol";
import "./common/meta-transactions/NativeMetaTransaction.sol";

contract OwnableDelegateProxy {}

contract ProxyRegistry {
    mapping(address => OwnableDelegateProxy) public proxies;
}

// W3rdle smart contract
contract W3rdl3 is
    ERC721URIStorage,
    Ownable,
    ContextMixin,
    NativeMetaTransaction
{
    using Counters for Counters.Counter;
    Counters.Counter public _tokenId;

    uint256 public ongoingMintPrice;
    address proxyRegistryAddress;
    mapping(address => bool) public minterMap;
    mapping(bytes5 => bool) public wordMap;
    mapping(uint8 => uint256) private rebates;
    string private baseURI;

    constructor(
        string memory _name,
        string memory _symbol,
        string memory _baseURI,
        uint256 _ongoingMintPrice,
        address _proxyRegistryAddress
    ) ERC721(_name, _symbol) {
        baseURI = _baseURI;
        ongoingMintPrice = _ongoingMintPrice;

        _tokenId.increment();
        _initializeEIP712(_name);

        proxyRegistryAddress = _proxyRegistryAddress;

        rebates[1] = 0.0005 ether;
        rebates[2] = 0.0004 ether;
        rebates[3] = 0.0003 ether;
        rebates[4] = 0.0002 ether;
        rebates[5] = 0.0001 ether;
    }

    function mintPriceCheck() internal {
        if (_tokenId.current() & 0x3FF == 0) {
            ongoingMintPrice += 0.001 ether;
        }
    }

    function register() public payable {
        require(
            msg.value >= ongoingMintPrice,
            "Failed: Please pay the appropriate ONGOINT_MINT_PRICE fee"
        );
        minterMap[msg.sender] = true;
        mintPriceCheck();
    }

    function mintWord(uint8 tries, bytes5 word)
        public
        payable
        returns (uint256)
    {
        require(
            minterMap[msg.sender] == true,
            "Player not allowed to mint. Please pay the appropriate ONGOINT_MINT_PRICE fee before minting"
        );
        require(
            wordMap[word] == false,
            "The word has already been minted by another player"
        );
        require(msg.sender == tx.origin, "No Bots"); // block smart contracts from minting

        minterMap[msg.sender] = false;
        wordMap[word] = true;

        uint256 newItemId = _tokenId.current();
        string memory _tokenURI;

        _tokenId.increment();
        _tokenURI = string(bytes.concat(bytes(baseURI), word, "-config.json"));

        _safeMint(msg.sender, newItemId);
        _setTokenURI(newItemId, _tokenURI);

        if (rebates[tries] > 0) {
            payable(msg.sender).transfer(rebates[tries]);
        }
        return newItemId;
    }

    function withdraw(uint256 amount) public payable onlyOwner {
        payable(msg.sender).transfer(amount);
    }

    function withdrawAll() public payable onlyOwner {
        payable(msg.sender).transfer(address(this).balance);
    }

    // Override approval to save gas
    function isApprovedForAll(address owner, address operator)
        public
        view
        override
        returns (bool)
    {
        ProxyRegistry proxyRegistry = ProxyRegistry(proxyRegistryAddress);
        if (address(proxyRegistry.proxies(owner)) == operator) {
            return true;
        }

        return super.isApprovedForAll(owner, operator);
    }

    // Make opensea proxy pay for some txns
    function _msgSender() internal view override returns (address sender) {
        return ContextMixin.msgSender();
    }
}

